import React from 'react';

export default ({ startDate, title }) => {

    let list_row = [];

    let newDate = new Date();
    let date = newDate.getDate();
    let month = newDate.getMonth() + 1;
    let year = newDate.getFullYear();


    for (let i = 0; i < title.length; i++)
    {
        list_row.push(
                        <tr>
                        <th scope="row">{i+1}</th>
                         <td>{newDate}</td>
                        <td>{title[i]}</td>
                        </tr>
                    )
    }



    return (
        <div>
            <table class="table">
                <thead class="thead-dark">
                    <tr>
                        <th scope="col">#</th>
                        <th scope="col">場次</th>
                        <th scope="col">時間</th>
                        <th scope="col">主題</th>
                    </tr>
                </thead>
                <tbody>
                    {list_row}
                </tbody>
            </table>
        </div>
    )
};
